import {Fragment} from 'react'

//Componente Funcional ou STATELESS
const CInstancias = (props) => {

return <React.Fragment ><div><p onClick={props.click}>Instancia: {props.nome} |
             Status: {props.status} </p>
             <button><img src="../../public/on.jpg" alt="on" onClick={this.myfunction} /></button>
             </div></React.Fragment>

}
export default CInstancias;
